package aqqje.com.lifecycle;public class Car {    private String name;    private double price;    public Car() {        System.out.println("Car Constroctor......");    }    public void init() {        System.out.println("Car init..");    }    public void destroy() {        System.out.println("Car destroy....");    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public double getPrice() {        return price;    }    public void setPrice(double price) {        this.price = price;    }    @Override    public String toString() {        return "Car{" +                "name='" + name + '\'' +                ", price=" + price +                '}';    }}